import React from "react";
import VideoThumbnail from "./video-thumbnail";
import Picture1 from "../images/video1.jpg";

export function ThumbContainer() {
  return <div className="thumb-container">
    <VideoThumbnail image = {Picture1} />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
  </div>;
}

